INSERT INTO `fichasreme` VALUES (1,'Tronquitos','manada','corporalidad','Todos','Inreractuar toda la manada y crear lazos fuertes','Se colocan todos los ni&ntilde;os en el suelo acostados panza abajo, uno de ellos se rueda lo m&aacute;s r&aacute;pido posible tratando de hacer el menor tiempo, gana el que mas r&aacute;pido lo haga.','Supervisar que no se golpeen con sus zapatos.','25min','SIN MATERIALES','2016-10-10 00:00:00',84),(3,'Veo a traves de los ojos de otro lobo','manada','caracter','6 o mas','IM: Escucho a los demas lobatos y lobeznas, a mis papas y a mis dirigentes.','-Se dividir&aacute;n en parejas y se colocan de frente.\r\n-A uno se le entregara un dibujo a base de figuras geom&eacute;tricas y al otro un l&aacute;piz y un papel.\r\n-el que tiene el dibujo va a ir describiendolo mientras el otro Lobato estara reproduciendolo en su papel.\r\n-se cambian de roles.\r\n-se comenta entre todos cu&aacute;l fue la parte m&aacute;s dificil y la m&aacute;s f&aacute;cil.','Intentar que lobatos que no se hablen sean pareja para que se conozcan.','20min','-1 dibujo por pareja</br>-2 hojas por pareja</br>-1 lapiz por pareja</br>','2016-10-24 00:00:00',27),(4,'Pasando a Mowgli','manada','corporalidad','6 o mas','IM: Participo en actividades que me ayudan a tener un cuerpo cada vez mas fuerte, agil, veloz y flexible.','Se coloca una meta a 10mtrs de distancia que seran las moradas frias, al silbatazo cort&oacute; el primer Lobato pasa a Mowgli (pelota) por entre sus piernas al compa&ntilde;ero de atr&aacute;s de el. Cuando Mowgli llega al final de la seisena, el &uacute;ltimo Lobato lo toma entre sus brazos y corre al principio de la seisena y vuelven a comenzar el juego. gana la seisena que llegue primero a la meta establecida.','Iniciar con la historia en la que Mowgli fue raptado por los bandarlogs y llevado a las moradas frias.','15-20min','-1 pelota por seisena</br>','2016-11-08 00:00:00',27),(7,'Nudo humano','tropa','sociabilidad','','Aprender. Tomar acuerdos y luderazgo','Se forma un circulo cerrado cuerpo a cuerpo con los integrantes y se les pide levantar su mano derecha la cual extiende hacia el frente tomando la de su compa&ntilde;ero que les quede de frente, luego la izquierda a cualquiera menos a los que tengan en sus dos lados inmediatos.\r\nSe organizar&aacute;n para desenrredarse sin soltar las manos hasta quedar un circulo sin judos y tomados de las manos.','Se puede hacer cualquier movimiento sin soltarse de las manos','5 minutos','SIN MATERIALES','2016-12-01 01:14:36',387),(8,'Pizca de huevos','tropa','sociabilidad','4-8','Organizaci&oacute;n grupal y cooperaci&oacute;n','Se coloca una cantidad de pelotas frente a los equipos y se les dar&aacute; un palo por cada integrante, al silbatazo se les pedir&aacute; que solo con ayuda del palo , en equipo tomar&aacute;n una pelota y la llevar&aacute;n hasta el lugar donde se encuentre un recipiente para juntar las m&aacute;s posibles.','Se podr&aacute; tener una variante de dificultad mezlando huevos de verdad con las pelotas','10-15 min','-Palos de paletas largos, pelotas de goma , recipientes de boca angosta</br>','2016-12-01 00:00:00',387),(9,'Evolucion Scout','tropa','sociabilidad','','Interacci&oacute;n y contacto entre los integrantes de diferentes patrullas','Es el juego cl&aacute;sico de piedra, papel o tijera. Se indica que al corto se formaran parejas -los participantes iniciar&aacute;n siendo un huevo-, mencionaran la frase Ichi Mini Joy y elegir&aacute;n con su mano que votar (papel gana a piedra, piedra a tijera y tijera a papel) el ganador evolucionar&aacute; a pollo, buscar&aacute; a su igual y repetir&aacute; su tiro, eta vez la evoluci&oacute;n ser&aacute; a gallina, posteriormente a chango, luego a humano y finalmente ser&aacute; un gur&uacute;. Ganar&aacute; el juego la patrulla que cuente con el mayor n&uacute;mero de gurus.','-','5-10 min','SIN MATERIALES','2016-12-01 04:07:24',361),(10,'Base Felina','tropa','creatividad','','Toma de decisiones en corto tiempo ','Es el juego de gato, se forman los casilleros con aros de pl&aacute;stico, un miembro de cada patrulla tirara por turnos. Cada tiro se realizar&aacute; con una pa&ntilde;oleta, el juego termina cuando una patrulla logre hacer un linea','-','5-10 min','-Aros de plástico de aproximadamente 50 cm de diámetro (9 pzas)</br>-</br>','2016-12-01 04:38:00',361),(11,'Veo, veo','tropa','creatividad','','Invitar a los participantes a tomar atenci&oacute;n de su entorno y relacionar las indicaciones con el objeto que buscan','El scouter comienza el juego con la frase veo, veonuna cosita que cosa es: un participante de cadanpatrulla intentar&aacute; adivinar por turno el objeto que el\r\nScouter observa, podr&aacute; pedir que le mencione una pista para facilitar adivinar el objeto. Gana la patrulla que adivine primero cu&aacute;l es el objeto.','-','5-10 min','SIN MATERIALES','2016-12-01 04:42:59',361),(12,'Vamos a estirarnos','tropa','corporalidad','2 o m&aacute;s ','Conocer que tan lelej,pueden llegar,a estirar su cuerpo, sin ser latimado.','Cada patrulla deber&aacute; hacer una tira humana, uniendo las puntas de los pies sin despegarse, tratandose de estirar lo mas que puedan.','Estirarse lo que su cuerpo pueda soportar, y no ecxederse para evitar una lesi&oacute;n ','5 min','-Cinta de medir</br>','2016-12-01 00:00:00',39),(13,'PERSIGUIENDO LA BANDERA','tropa','corporalidad','4 O MAS','que el scout sepa que es bueno ejercitarse con ayuda de un equipo','Se amarran unas ligas gruesas a un arbol o poste, a cierta distancia se entierran o podr&aacute;n banderas.Un integrante de cada patrulla deber&aacute; amarrarse a la liga y utilizar su fuerza para poder alcanzar las banderas, gana el que mas banderas junte en menos tiempo','Tener cuidado con las lesiones f&iacute;sicas causadas por la fuerza empleada','15 min','-10 banderas( pañuelos)  2 ligas gruesas</br>','2016-12-01 05:32:56',387),(14,'Estructuras que unen','tropa','corporalidad','10 a mas','Que por medio de la la agilidad mental y fisica puedan desarrollar sus destresas corporales para llegar su objetivo','Se desarrollara teniendo dos vasijas una con agua y la otra sola.Elegir a una persona por patrulla para pasar por arriba. Se formara una hilera de parejas por patrulla,cada pareja tendra un tramo de madera como de 30cm por la que pasara la persona que se eligio.la persona que se eligio para pasar llevara un resipiente con agua el cual tendra que pasar por ensima de los troncos que sostendran cada pareja de patrulleros hasta llegar a la vasija que esta sola la cual se tiene que llenar','Observar cuidadosamente el procedimento por desarrollarse en cuestion de la forma que se va subir al patrullero para evitar leciones ','15 a 20','-Tramos de madera de 30cm,  4 recipientes grandes(cubetas o vasijas),2 resipientes pequeños (vasos o tazas) </br>','2016-12-01 15:33:51',362),(15,'Enredados ','tropa','creatividad','De 6 a 9','Fortalecer las habilidades de la patrulla para solucionar problemas en equipo','Se lleva previamente elaborada una trenza con 8 cabos de aproximadamente 3 metros de largo.\r\n\r\nDos patrulla a la vez se colocan una a cada extremo de la trenza y se atan un cabo al tobillo.\r\n\r\nLa trenza siempre debe permanecer tensa a la vez que la patrulla trata de deshacer la misma.\r\n\r\nLa actividad termina cuando se agota el tiempo o la trenza es  deshecha completamente.\r\n\r\nSe califica la capacidad de la patrulla para completar el reto ','Que los participantes no estiren demaciado la trenza.','10-15min','-</br>','2016-12-01 16:14:53',360),(16,'Buscaminas ','tropa','creatividad','12 a 16','El scout fortalezca su capacidad de aprender y resolver problemas','Dos equipos se forman al pie de una cuadr&iacute;cula, al silbatazo corto, salen de uno en uno para cruzar &quot;el campo de minas&quot;. De acuerdo al mapa del campo que el scouter tendr&aacute;, (donde est&aacute;n ubicadas la bombas) determinar&aacute; si se regresa hasta el principio o si contin&uacute;a, el equipo que complete primero el campo, ser&aacute; mejor calificado. ','','10-15 min','-Plano cuadriculado del campo de minas y 5 mapas de las bombas en la cuadrícula</br>','2016-12-01 17:02:15',363),(17,'Dakji','tropa','corporalidad','2 o m&aacute;s ','Potenciar la capacidad de concentracion y destreza del muchacho','El dakji esbun juego popular coreano, que funciona como los tacos en M&eacute;xico,  el dakji es hecho con papel o cart&oacute;n (sera sustituido por monedas antiguas)\r\nCada patrulla tendra dos dakji, tendra un turno consecuente, si alguno de los integrantes voltea el dakji del contrincante, este saldr&aacute; del juego y por ende perdera.','Cada vez que un jugador tire, los demas darle su espacio.','5 min','-Monedas antiguas</br>','2016-12-01 19:26:15',39),(18,'Cuanto aguantas?','tropa','corporalidad','','que los chicos  aprendan a controlar  su cuerpo a pesar de las  advercidades q se les precenten','deberan ponerce en pocicion de vela mientras el transcurso del tiempo se les  daran diferentes tareas a realizar ( detener  cierto numero de pelotas mientras mantienen la pocicion ) al no lograrlo seran merecedores de un castigo (toques) :)','tener cuidado con lesiones fisicas q puedan originase al estar en la pocision sugerida ','5 a 10min','-pelotas de goma,maquina para dar toques :)</br>','2016-12-01 21:37:12',14),(20,'Bailas??','tropa','corporalidad','10 o mas','Todos los participantes logren estar dentro del c&iacute;rculo ','Al ritmo de la m&uacute;sica, los scouts bailar&aacute;n alrededor de un c&iacute;rculo hecho con una soga, por per&iacute;odos cortos se escuchar&aacute; la m&uacute;sica al no escucharla deber&aacute;n entrar al c&iacute;rculo, conforme avance el juego el c&iacute;rculo se ir&aacute; reduciendo, por lo que no debe quedar nadie fuera.\r\n El juego termina al terminar la canci&oacute;n. ','Realizar la actividad en un espacio amplio\r\nEmpezar con c&iacute;rculo de tama&ntilde;o considerable, para que puedan entrar todos los jugadores ','10- 15 min','-Soga </br>-Bocina </br>','2016-12-02 00:44:33',355),(22,'Tómame una foto','tropa','sociabilidad','10 o mas','Tomarse una fotograf&iacute;a con todos los integrantes de la patrulla','Usando un marco de cart&oacute;n decorado,  a una altura de 1.70mts,  los scouts deber&aacute;n saltar para aparecer en la fotograf&iacute;a que ser&aacute; tomada por el scouter.\r\nSe realizar&aacute;n varias tomas en 1 min. En el cual toda la patrulla deber&aacute; saltar para obtener la fotograf&iacute;a con la mayor cantidad de integrantes ','Desarrollarla en un espacio amplio al aire libre o al interior de un aula. Con espacio adecuado para saltar libremente ','10-15 min ','-Marco decorado de carton</br>-Cámara fotográfica o celular con camara </br>','2016-12-02 00:54:25',355),(24,'Leyendo leyendo','tropa','creatividad','10 o mas','Que los chavos logren fortalecer su capacidad de atenci&oacute;n,concentraci&oacute;n y cooordinaci&oacute;n linguistica','en una cartulina estar&aacute; un mensaje , cada integrante lo deber&aacute; leer lo mas r&aacute;pido posible sin equivocarse, &oacute; deber&aacute; empezar\r\nvariaci&oacute;n; rompecabezas de cartulina para formar la frase correcta, usando imagenes para que los chavos puedan intentar interpetarlo correctamente.','tener un cron&oacute;metro para tomar tiempo de la actividad','5-7 min','-cartulinas con mensaje e imágenes</br>','2016-12-02 01:50:22',387),(25,'CARRERA PALOS BORRACHOS','tropa','corporalidad','10 O M&Aacute;S','Que todos scout aprenda los beneficios de ejercitarse','Se pondr&aacute; a cada scout en una distancia considerable de aprox, 3 metros, se les dar&aacute; un palo y deber&aacute;n de dar 10 vueltas al palo, al terminar salir corriendo a dondeest&aacute; el siguiente integrante\r\nel primero en terminar gana','ninguna','5-7 min','-palos </br>','2016-12-02 01:59:35',387),(26,'hula hula electrica!!!','tropa','creatividad','','que los chicos encuentren la manera de sacarse el hula del cuerpo','todos los muchachos deben estar agarrados de la mano mientras el de la punta sostendra un hula hula q deveran pasarce por el cuerpo hasta pasar por el ultimo chico  mientras va pasando el hula hula  tienen q soportar al mismo tiempo una peque&ntilde;a descarga  electrica :)','se devera mantener mucha atencion  al momento de darles los toques a los muchachos   y que sea lo mas soportable para ellos','3 a 5min','-hula hula y maquina de toques con regulador</br>','2016-12-02 03:58:19',14),(27,'hula hoop food','tropa','corporalidad','2 en adelante','potenciar la capacidad de concentracion y destreza de los chicos','cada patrulla devera elegir un miembro que los reprecente,uno de ellos devera de sostener algun alimento(velitas de dulce u otro q se les ocurra) mientra que con su brazo en el que la sostiene girara un hula hula,mientras el otro chico intentara agarrar el alimento con la boca sin meter las manos. al realizarlo se cambian los roles y quien lo haga en el menor tiempo sera el vencedor.','','5min','-hula hula ,gomitas de dulce en forma de velitas (o cualquier alimento  de su agrado)</br>','2016-12-02 04:24:28',14),(28,'adivina quien esta sentado','tropa','creatividad','10 o mas','Que los chavos logren fortalecer su capacidad de atenci&oacute;n y concentraci&oacute;n.','En una mesa con un  mantel largo las dos patrullas se ponen frente a frente, habr&aacute; solo un banco a cada lado, solo un integrante podr&aacute; sentarse y los dem&aacute;s simular&aacute;n que est&aacute;n sentados.\r\nla otra patrulla dever&aacute; adivinar quien es la persona sentada, mientras la otra patrulla dever&aacute; de pensar en como hacer lo mejor posible para enga&ntilde;ar a la otra','ninguna','5-7 min','-bancos mantel y mesa</br>','2016-12-02 04:35:36',387),(29,'Adivina donde estoy','tropa','creatividad','5 o m&aacute;s','Que los muchachos logren potenciar su capacidad de concentraci&oacute;n y atenci&oacute;n ','Se escoger&aacute; a una persona (los muchachos deciden)  y despu&eacute;s se cubrir&aacute; completamente a los muchachos con una lona. La persona que se escogi&oacute; anteriormente deber&aacute; adivinar y se&ntilde;alar con una pa&ntilde;oleta o pa&ntilde;uelo donde esta el compa&ntilde;ero que el scouter le haya dicho que buscara. Tendr&aacute; un l&iacute;mite de intentos de 2 por persona','Ninguna','5 - 7 minutos ','-1 lona grande</br>-1 pañuelo </br>','2016-12-02 20:20:28',4),(30,'Copiadora descompuesta ','tropa','creatividad','5 o m&aacute;s ','Trazar lo m&aacute;s similar posible al dibujo original. Reforzar la comunicaci&oacute;n entre los muchachos. Aumentar su percepci&oacute;n y concentraci&oacute;n','Hacer saber que los muchachos no pueden hablar durante la actividad. Se deben formar a los muchachos en una fila. Mostrar el dibujo &uacute;nicamente al &uacute;ltimo/primero de la fila. Los muchachos &quot;dibujaran&quot;  en la espalda del compa&ntilde;ero de tal forma que el trazo pase al primero/&uacute;ltimo muchacho quien lo dibujara en el papel. El dibujo m&aacute;s fiel al original gana *en este caso mientras m&aacute;s fiel al original,  mejor puntuaci&oacute;n tendr&aacute;*','Ninguna ','5 -  10 min','-Dibujos o figuras a trazar</br>-Papel y lápiz/pluma/marcador </br>','2016-12-02 20:25:23',4);
